import React from "react";
import { Link } from "react-router-dom";
import { fetchUserData } from "../utility/api";



const Profile = async ({token, userName}) =>{
    const userData = await fetchUserData(token)
    console.log(userData)


    return (
        <>
            <div id="profile-container">
                {
                    !token ? 
                    <Link to="/login" id="profile-title">(Please Log In)</Link> :
                    <>
                        <h1 className="profile-title">WELCOME {userName}</h1>
                        <h2 className="profile-title">Sent Messages</h2>
                        {
                            userData.data.messages.map(message =>{
                                <li>{message.content} from Account: {message.fromUser.userName}</li>
                            })
                        }
                        <h2 className="profile-title">Received Messages</h2>
                    </>
                }

            </div>

        </>
    )

}


export default Profile
